import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Accomodation from "./pages/accomodation/accomodation"; // This is your dynamic component for accommodation
import TouristPlaces from "./pages/tourist_places/tourist_places"; // Similarly, import other pages for routing
import FoodPlaces from "./pages/food_places/food_places";
import Transportation from "./pages/transportation/transportation";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/accomodation" element={<Accomodation />} />
        <Route path="/places" element={<TouristPlaces />} />
        <Route path="/food" element={<FoodPlaces />} />
        <Route path="/buses" element={<Transportation />} />
      </Routes>
    </Router>
  );
}

export default App;
